                canton = self.env['mw.canton'].sudo().search([('province','=',province.id),('code','=',ubication['canton_id'])])
                if not canton:
                    canton = self.env['mw.canton'].sudo().create({'province' : province.id, 'name': ubication['canton'], 'code': ubication['canton_id']})
